{'section_data': {'createdAt': 1755984888000, 'editPromptValue': '', 'lines': [1, 97], 'summaryData': "This code defines a React functional component called StockChart that takes stock data as a prop, processes it to extract and format monthly closing prices, and renders a responsive line chart using Recharts to visualize the stock's price trends by month, with labeled axes, tooltips, and a legend.", 'title': 'Untitled', 'metadata': {'id': 'a1c32165-257a-49bc-9d68-833036c2bf64', 'filename': 'StockChart.jsx', 'offset': 0, 'fullPath': '/project/workspace/frontend/src/StockChart.jsx', 'originalCode': 'import React from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
  ReferenceLine,
} from "recharts";

const StockChart = ({ data }) => {
  if (!data || !data.data || !data.data.length) return null;

  const company = data.name;
  const ticker = data.ticker;

  // Helper function to format date strings to "YYYY-MM" (month only)
  const formatDateString = (date) => {
    if (!date) return "";
    const tIndex = date.indexOf("T");
    const cleanDate = tIndex !== -1 ? date.substring(0, tIndex) : date;
    const [year, month] = cleanDate.split("-");
    return `${year}-${month}`;
  };

  // Combine labels and values into an array of objects for Recharts
  const chartData = data.data.map((item) => ({
    date: formatDateString(item.date),
    price: item.close,
  }));

  // Array of month abbreviations
  const monthNames = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
    "Dec",
  ];

  // Get months as "01" to "12" for ticks
  const monthTicks = monthNames.map((_, idx) =>
    String(idx + 1).padStart(2, "0")
  );

  // Custom tick formatter to show only month abbreviation
  const monthTickFormatter = (date) => {
    if (!date) return "";
    const parts = date.split("-");
    const month = parts[1];
    const monthIdx = parseInt(month, 10) - 1;
    return monthNames[monthIdx] || "";
  };

  // Map chartData to have only month for XAxis dataKey
  const chartDataWithMonth = chartData.map((item) => ({
    ...item,
    month: item.date.split("-")[1],
  }));

  return (
    <div style={{ marginTop: "2rem" }}>
      <h3>
        {company} ({ticker})
      </h3>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart
          data={chartDataWithMonth}
          margin={{ top: 10, right: 30, left: 0, bottom: 0 }}
        >
          <XAxis
            dataKey="month"
            ticks={monthTicks}
            tickFormatter={monthTickFormatter}
            interval={0}
          />
          <YAxis domain={["auto", "auto"]} />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="price" stroke="#8884d8" dot={false} />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
};

export default StockChart;
'}}, 'section_id': 'a1c32165-257a-49bc-9d68-833036c2bf64'}

