{'section_data': {'createdAt': 1755985121000, 'editPromptValue': '', 'lines': [1, 47], 'summaryData': 'This code sets up an Express.js server with CORS and JSON parsing enabled, provides a simple hello endpoint, and exposes an API route that fetches and returns daily stock data (date, close price, and volume) for a given symbol from Yahoo Finance starting from January 1, 2024, handling errors appropriately.', 'title': 'Untitled', 'metadata': {'id': 'a4a00331-32d0-45ed-849e-b195672ead36', 'filename': 'index.js', 'offset': 0, 'fullPath': '/project/workspace/server/index.js', 'originalCode': 'const express = require("express");
const cors = require("cors");
const yahooFinance = require("yahoo-finance2").default;

const app = express();
const PORT = 3000;

app.use(cors());
app.use(express.json());

app.get("/api/hello", (req, res) => {
  res.json({ message: "Hello from the backend!" });
});

app.get("/api/stock/:symbol", async (req, res) => {
  try {
    const symbol = req.params.symbol.toUpperCase();
    const data = await yahooFinance.chart(symbol, {
      period1: "2024-01-01",
      interval: "1d",
    });
    const quotes = data.quotes;

    const companyName = data.meta?.shortName || symbol;

    const response = {
      ticker: symbol,
      name: companyName,
      data: quotes.map((q) => ({
        date: q.date,
        close: q.close,
        volume: q.volume,
      })),
    };

    console.log(response);
    res.json(response);
  } catch (err) {
    console.error(err);
    res.status(500).send("Error fetching stock data");
  }
});

app.listen(PORT, "0.0.0.0", () => {
  console.log(`Server running on http://localhost:${PORT}`);
});
'}}, 'section_id': 'a4a00331-32d0-45ed-849e-b195672ead36'}

