{'section_id': 'ea5dd923-1f69-46fd-bca9-14e74dfccb00', 'section_data': {'summaryData': 'This code defines functions to scrape NBA MVP voting results and player per-game statistics from Basketball Reference for seasons 20182025, processes and consolidates the data, and, when run as a script, saves the results as CSV files in a local "data" directory.', 'metadata': {'offset': 0, 'fullPath': '/project/workspace/scraper.py', 'id': 'ea5dd923-1f69-46fd-bca9-14e74dfccb00', 'filename': 'scraper.py', 'originalCode': 'import pandas as pd
